import React from 'react'
import NoteCard from './NoteCard'

const NotesList = (props) => {


    const handleDetails = (param) => {
        props.getDetails(param);

    }


    const RenderNotes = props.passNotesList.map((each) =>{
        console.log(each.key.toString())
        return(
            <div>
                <NoteCard key={String(each.key)} passNoteData={each} getDetails={handleDetails}/>
            </div>            
        );
    })

    return (
        <div  align="center">
        <div style={{"maxWidth":"90%","display":"grid","gridTemplateColumns": "repeat(auto-fit, minmax(300px, 1fr))"}}>
            {RenderNotes}
        </div>
        </div>



    )
}

export default NotesList;
